The nine United States Geological Survey maps used to determine the boundary of the Northern Sonoma viticultural area are titled:

(1) Sonoma County, California, scale 1:100 000, 1970;

(2) Asti Quadrangle, California, scale 1:24 000, 1959, photorevised 1978;

(3) Jimtown Quadrangle, CaliforniaSonoma County; scale 1:24 000, 1955, photorevised 1975;

(4) Camp Meeker Quadrangle, CaliforniaSonoma Co., scale 1:24 000, 1954, photorevised 1971;

(5) Valley Ford Quadrangle, California, scale 1:24 000, 1954, photorevised 1971;

(6) Two Rock Quadrangle, California, scale 1:24 000, 1954, photorevised 1971;

(7) Cotati Quadrangle, CaliforniaSonoma Co., scale 1:24 000, 1954, photorevised 1980;

(8) Santa Rosa Quadrangle, CaliforniaSonoma Co., scale 1:24 000, 1954, photorevised 1980; and

(9) Mark West Springs Quadrangle, California, scale 1:24 000, 1993.
